import React, { useState } from "react";
import axios from 'axios';
import { Link } from 'react-router-dom';
import "./Logsig.css";
import sign from "./signin.png";

function Mainsignin() {


  const [signinData, setSigninData] = useState({
    email: '',
    username: '',
    password: '',
    confirm: '',
  });

  const handleChange = (event) => {
    const { name, value } = event.target;
    setSigninData({
      ...signinData,
      [name]: value,
    });
  }

  const handleSubmit = async (event) => {
    event.preventDefault();

    try {
      // Send the signinData object to your server
      const response = await axios.post("http://localhost:8000/signup", signinData);
      // Handle success or any other actions here
      console.log("Data sent successfully:", response.data);
    } catch (error) {
      // Handle errors here
      console.error("Error sending data:", error);
    }
  }
  return (
    <>
      <div>
        <form className="form" method="post" onSubmit={handleSubmit}>
          <h1 className="header22">SIGNUP</h1>
          <div className="flex-column">
            <label>Username</label>
          </div>
          <div className="inputForm">
            <input
              required
              placeholder="Enter your Name"
              className="input"
              type="text"
              name="username"
              value={signinData.username}
              onChange={handleChange}
            />
          </div>

          <div className="flex-column">
            <label>Email ID</label>
          </div>
          <div className="inputForm">
            <input
              required
              placeholder="Enter your Email (clg Mail)"
              className="input"
              type="text"
              name="email"
              value={signinData.email}
              onChange={handleChange}
            />
          </div>
          <div className="flex-column">
            <label>Password</label>
          </div>
          <div className="inputForm">
            <input
              required
              placeholder="Enter your Password"
              className="input"
              type="text"
              value={signinData.password}
              name="password"
              onChange={handleChange}
            />
          </div>
          <div className="flex-column">
            <label>Confirm Password</label>
          </div>
          <div className="inputForm">
            <input
              required
              placeholder="Confirm Password"
              className="input"
              type="text"
              name="confirm"
              value={signinData.confirm}
              onChange={handleChange}
            />
          </div>

          <button type="submit" className="button-submit">
            Sign In
          </button>

          <div className="login">
            <p>If existing user <Link to="/Mainlogin"><span>Login</span></Link></p>
          </div>
        </form>
      </div>
    </>
  );
}

export default Mainsignin;
